import styled from "styled-components";

export const AppContainer = styled.div`
    background: darkslateblue;
    width: 100%;
    height: 100vh;
    padding: 2em 8em;
    // margin: 0 6.5em;
    // border-left: 0.1em solid darkorange;
    /* border-radius: 5px; */
    & {
    color: black;
  } 
`
export const HomeContainer = styled.div`
    width: 100%;
    height: 100vh;
    padding: 2em 8em;
    // margin: 0 6.5em;
    // border-left: 0.1em solid darkorange;
    /* border-radius: 5px; */
    & {
    color: blue;
  } 
`
export const UserContainer = styled.div`
    width: 100%;
    height: 100vh;
    padding: 2em 8em;
    // margin: 0 6.5em;
    // border-left: 0.1em solid darkorange;
    /* border-radius: 5px; */
    & {
    color: darkcyan;
  } 
`
export const CategoryContainer = styled.div`
    width: 100%;
    height: 100vh;
    padding: 2em 8em;
    // margin: 0 6.5em;
    // border-left: 0.1em solid darkorange;
    /* border-radius: 5px; */
    & {
    color: darkorange;
  } 
`

export const ProductContainer = styled.div`
    // width: 100%;
    // height: 100vh;
    // overflow-x: auto;
    // overflow-y: auto;
    // padding: 2em 8em;
    // // margin: 0 6.5em;
    // // border-left: 0.1em solid darkorange;
    // /* border-radius: 5px; */
    position: fixed;
    top: 0;
    right: 0;
    bottom: 0;
    left: 60px;
    display: flex;
    align-items: ${({ tall }) => (tall ? 'flex-start' : 'center')};
    justify-content: center;
    background-color: rgba(29, 49, 65, 0.8);
    overflow-x: hidden;
    overflow-y: auto;
    -webkit-overflow-scrolling: touch;
    padding: 1.2rem;
    z-index: 1031;
`

export const OrderContainer = styled.div`
    width: 100%;
    height: 100vh;
    padding: 2em 8em;
    // margin: 0 6.5em;
